import React from 'react';
import MainPage from './MainPage'
import ProjectPage from './ProjectPage'

import {
  BrowserRouter as Router,
    Switch,
    Route
} from 'react-router-dom'


function App() {
  return (
      <Router>
        <Switch>
          <Route exact={true} path='/projects'>
            <ProjectPage/>
          </Route>
          <Route exact={true} path='/'>
            <MainPage/>
          </Route>
        </Switch>
      </Router>
  );
}

export default App;
